class Solution(object):
    #find the most proper Index to begin looking around
    def findMidIndex(self, citations):
        midIndex = len(citations)/2
        countFromMid = len(citations) - midIndex
        
        # smallest number from [midIndex,...,tail]  is bigger than count of this set , expand towards head
        if citations[midIndex] == countFromMid:
            return midIndex
            
        if citations[midIndex] > countFromMid :
            while midIndex >= 0 and citations[midIndex] > countFromMid:
                if midIndex > 2:
                    midIndex = midIndex/2
                else:
                    midIndex -= 1 
                countFromMid = len(citations) - midIndex

        # smallest number from [midIndex,..., tail] is smaller than count of this set, shrink towards tail
        else: # citations[midIndex] < countFromMid:
            while midIndex <= len(citations) -1 and citations[midIndex] < countFromMid:
                if (len(citations) - midIndex)/2 > 1:
                    midIndex += (len(citations) - midIndex)/2
                else:
                    midIndex += 1
                countFromMid = len(citations) - midIndex
        
        return midIndex 
                
    def hIndex(self, citations):
        """
        :type citations: List[int]
        :rtype: int
        """
        if citations is None or len(citations) == 0:
            return 0
        
        midIndex = self.findMidIndex(citations)
        countFromMid = len(citations) - midIndex
        
        if midIndex < 0: #countFromMid > len(citations):
            return len(citations)
        
        if midIndex > len(citations) - 1:
            return 0
            
        if citations[midIndex] == countFromMid:
            return countFromMid
            
        if citations[midIndex] > countFromMid:
            while citations[midIndex] > countFromMid:
                countFromMid += 1
                midIndex -= 1
            if citations[midIndex] < countFromMid: 
                #1.even the smallest number of this set > the number of element in it
                #2.if last set is bigger than count and this current set is smaller than count, then take last set count
                return countFromMid - 1
            else: #citations[midIndex] == countFromMid
                return countFromMid
                
        #if lowest of (current elements counted) < count, need to shrink the sets towards the tail 
        else: #citations[midIndex] < countFromMid
            while citations[midIndex] < countFromMid :
                countFromMid -= 1
                midIndex += 1
            if midIndex == len(citations) :# countFromMid is 0 yet still all element smaller than 0
                return 0
            else: # citations[midIndex] >= countFromMid,  finally a set with starting number larger than its count
                return countFromMid
                                
                
